import styled from 'styled-components'

export const ImageButtonContainer = styled.div`
    display: flex;
    align-items: center;
    border: 1px solid black;
    border-radius: 50px;
    width: 200px;
    padding: 15px 30px;
    margin: 10px auto;
    background-color: white;
`

export const Image = styled.img`
    width: 20px;
    margin-right: 20px;
    
`
